import React, {useState} from "react";
import {eventsData} from "../utils/data";

export const Main = () => {
    const [events, setEvents] = useState(eventsData)
    return(

        <div>
            {events.map((event, index) => (
                <h4 key ={event.id}>{event.title} </h4>
            ))}
        </div>
    )
}
